import './Hello.css'
class Hello extends Component {

  render() {	
  	return(

  	<div class='f1 tc'>
  	 <h1> Hello world </h1>
  	 <p> Hello This is my first React </p>

  	</div>

  	);

  }
}


export default Hello;
